- name: error
  uid: excel!Excel.Interfaces.FunctionResultData#error:member
  package: excel!
  fullName: error
  summary: >-
    エラー値 (" \# DIV/0" など) を表すエラー値。 エラー文字列が設定されていない場合は、関数が正常に終了し、その結果が Value フィールドに書き込まれます。 エラーは常に英語のロケールです。


