- name: value
  uid: excel!Excel.Interfaces.FunctionResultData#value:member
  package: excel!
  fullName: value
  summary: >-
    関数評価の値。 エラーが発生していない場合にのみ、value フィールドに値が設定されます (つまり、Error プロパティが設定されていない場合)。


